$(document).ready(function () {

  $('.copy-paste').on('click', function (e) {
    e.preventDefault();
    $(this).fadeOut(100).fadeIn(100);
  });

  new Clipboard('a.copy-paste', {
    target: function(trigger) {
      return trigger.nextElementSibling;
    }
  });
});;
var allString = Drupal.t('All');

Drupal.behaviors.checkFilters = {
  attach: function (context, settings) {
    checkYear($("select[name=year_filter]"));
  }
};

$(document).ready(function () {

  // Equalize element heights.
  $(window).resize(function () {
    NokiaEqualHeights();

    // Make sure mobile footer menu close button disappear on tablet and desktop.
    if (nokiaResize.context != 'mobile') {
      $('#block-nokiaglobalfooter h6.mobile-expand').removeClass('expanded');
    }
  });
  NokiaEqualHeights();

  function NokiaEqualHeights() {
    setTimeout(function () {
      $('.equalheight-wrapper').each(function () {
        if (nokiaResize.context != 'mobile') {
          $(this).children('.equalheights').css('height','initial');
          $(this).children('.equalheights').equalHeights();
        } else {
          $(this).children('.equalheights').css('height','auto');
        }
      });
    }, 100);
  }

  // Move share this widget.
  if($('.block-sharethiswidget').length > 0 && $('.body.full').length > 0) {
    $('.block-sharethiswidget').detach().insertBefore('.body.full');
  }

  // Fix share this block formatting in lander.
  if ($('.panel-lander .p-header .sharethis-wrapper').length > 0) {
    $('.panel-lander .p-header .sharethis-wrapper').parent().addClass('og-2 social-share-block');
  }

  /*** Press release views filter *********************************************/
  if($('#edit-submit-press-releases').length) {

    // set default month
    $("select[name=month_filter]").val(allString);

    // HACK to get around ajax filters showing nothing by default
    $('form.views-exposed-form input[type=submit]').trigger('click');

    // Hide the month granularity year option
    if (!$("select[name=year_filter]").val() || $("select[name=year_filter]").val() == allString) {
      $("select[name=month_filter]").prev().addClass("select2-container-disabled");
    }
  }

  /*** Views exposed filter ***************************************************/
  $(document).on('click', '.select2-container-disabled', function () {
    return false;
  });

  $(document).on('change', '.views-exposed-form select', function () {
    // Submit the form
    $('form.views-exposed-form input[type=submit]').trigger('click');
  });

  /*** Event calendar views filter *********************************************/
  if($('#edit-field-event-categories').length > 0) {
    $(document).on('change', '.views-exposed-form select', function () {
      // Submit the form
      $('form.views-exposed-form input[type=submit]').trigger('click');
    });
  }

  /*** Global footer mobile ****************************************************/
  if ($('#block-nokiaglobalfooter').length > 0) {
    // Ensure only one mobile footer menu expando is opened.
    $(document).on('click', '#block-nokiaglobalfooter h6.mobile-expand', function () {

      if (nokiaResize.context == 'mobile') {
        var selected_index = $(this).attr('data-index');

        if (selected_index == 1) {
          $('#block-nokiaglobalfooter h6[data-index="2"]').next('ul').slideUp('slow');
          $('#block-nokiaglobalfooter h6[data-index="3"]').next('ul').slideUp('slow');
          $('#block-nokiaglobalfooter h6[data-index="2"]').removeClass('expanded');
          $('#block-nokiaglobalfooter h6[data-index="3"]').removeClass('expanded');
        }
        else if (selected_index == 2) {
          $('#block-nokiaglobalfooter h6[data-index="1"]').next('ul').slideUp('slow');
          $('#block-nokiaglobalfooter h6[data-index="3"]').next('ul').slideUp('slow');
          $('#block-nokiaglobalfooter h6[data-index="1"]').removeClass('expanded');
          $('#block-nokiaglobalfooter h6[data-index="3"]').removeClass('expanded');
        }
        else if (selected_index == 3) {
          $('#block-nokiaglobalfooter h6[data-index="1"]').next('ul').slideUp('slow');
          $('#block-nokiaglobalfooter h6[data-index="2"]').next('ul').slideUp('slow');
          $('#block-nokiaglobalfooter h6[data-index="1"]').removeClass('expanded');
          $('#block-nokiaglobalfooter h6[data-index="2"]').removeClass('expanded');
        }
      }
    });
  }


  nokiaAnalytics.webcast();

});

/**
 * Check year value of press release filter
 * @param input
 */
function checkYear (input) {
  if (!input.val() || input.val() === allString) {
    $("select[name=month_filter]").val(allString);
    $("select[name=month_filter]").prev().addClass("select2-container-disabled");
  }
  else {
    $("select[name=month_filter]").prev().removeClass("select2-container-disabled");
  }
}


var nokiaAnalytics = {}

/**
 * This function is used to track press-subscription-form
 * /en_int/news/releases/subscribe
 */
nokiaAnalytics.subscribed = function () {
  if ( typeof dataLayer !== 'undefined' ){
    // push GTM end event.
    return dataLayer.push({
      'event': 'formSubmitted',
      'action': 'Subscribed press releases',
      'label': window.location.href
    });
  }
};

/**
  * GTM event for the MWC webinar
  * This function is in use here /en_int/about-us/news-events/mobile-world-congress-2017/press-analyst-info/webcast
  **/
nokiaAnalytics.webcast = function () {
  if ( typeof dataLayer !== 'undefined' ){
    // push GTM end event.
    $('#videocontainer1').on('mouseenter', function () {
      dataLayer.push({
        'event': 'webcast-play',
        'action': 'play',
        'label': window.location.href
      });
    });
  }
};
;
